import React from 'react';
import { Box, Typography } from '@mui/material';

const Footer = () => {
    return (
        <Box component="Footer" sx={{mt:'auto', p:2, backgroundColor: '#f5f5f5'}}>
            <Typography align='center'>2024 Staff Management</Typography>
        </Box>
    );
};

export default Footer;
